/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { useState } from 'react';
import LandingPage from './HomePage';



function App() {
  const [darkMode, setdarkMode] = useState("has-background-black-bis")
  const [home, setHome] = useState(0)

  const toggleDarkMode = () => {
    setdarkMode("has-background-white-bis")
  }

  cons

  return (
    <section className={`hero is-fullheight id-dark ${darkMode}`}>
      <div className="hero-head">
        <header className="navbar">
          <div className="container">
            <div id="navbarMenuHeroC" className="navbar-menu">
              <div className="navbar-end">
                <div className="navbar-item">
                  <div class="field">
                    <input id="switchRoundedInfo" type="checkbox" name="switchRoundedInfo" className="switch is-rounded is-info"/>
                    <label for="switchRoundedInfo">Toggle Dark Mode</label>
                  </div>
                </div>
              </div>
            </div>
          </div>

        </header>
      </div>
      <div className="hero-body">
        <div className="container has-text-centered">
          <h1 className="title">
            Zuby.io
      </h1>

        </div>
      </div>
    </section>



  );
}

export default App;
